/**
 * 
 * 给你字符串 s 和整数 k
 * 请返回字符串 s 中长度为 k 的单个子字符串中可能包含的最大元音字母数
 * 
 * 示例 1：
 * 输入：s = "abciiidef", k = 3
 * 输出：3
 * 解释：子字符串 "iii" 包含 3 个元音字母。
 * 
 * 示例 2：
 * 输入：s = "aeiou", k = 2
 * 输出：2
 * 解释：任意长度为 2 的子字符串都包含 2 个元音字母。
 * 
 * 示例 3：
 * 输入：s = "leetcode", k = 3
 * 输出：2
 * 解释："lee"、"eet" 和 "ode" 都包含 2 个元音字母。
 * 
 * 示例 4：
 * 输入：s = "rhythms", k = 4
 * 输出：0
 * 解释：字符串 s 中不含任何元音字母。
 * 
 * 示例 5：
 * 输入：s = "tryhard", k = 4
 * 输出：1
 * 
 */

//! 暴力解法 穷举出所有子数组 执行时间超长
function maxVowels(s: string, k: number): number {
    let vowel = 0
    let sub_string = [];
    for (let index = k; index <= s.length; index++) {
        sub_string.push(s.slice(index - k, index));
    }

    sub_string.forEach(str => {
        vowel = Math.max(vowel, str.split("").filter(i => 'aeiou'.includes(i)).length)
    })

    return vowel
};

//* 滑动窗口
function theMaxVowels(s: string, k: number): number {
    let vowel = 0, ans = 0;
    for (let index = 0; index < s.length; index++) {
        // 1. 右端点进入窗口
        if (s[index] === "a" || s[index] === "e" || s[index] === "i" || s[index] === "o" || s[index] === "u") {
            vowel++
        }

        let left = index - k + 1; // 窗口左端点
        if (left < 0) continue; // 窗口大小不足 k，尚未形成第一个窗口

        // 2. 更新答案
        ans = Math.max(ans, vowel);
        if (ans === k) break;  // 答案已经等于理论最大值 无需再循环

        if (s[left] === "a" || s[left] === "e" || s[left] === "i" || s[left] === "o" || s[left] === "u") {
            vowel--;
        }
    }
    return ans
};


if (import.meta.vitest) {
    const { it, expect, test } = import.meta.vitest
    it.only("case1", () => {
        const s = "abciiidef"
        const k = 3;
        expect(theMaxVowels(s, k)).toEqual(3)
    })
    it("case2", () => {
        const s = ""
        const k = 274
        expect(theMaxVowels(s, k)).toEqual(72)
    })
    it.only("case1", () => {
        const s = "aeiou"
        const k = 3;
        expect(theMaxVowels(s, k)).toEqual(3)
    })
}